INSERT INTO `b_teacher` VALUES (5, '刘文静', '21', '女', 'b6577e59-f9a6-490c-aaf8-98ae26d97a90.jpeg', '擅长健身瑜伽指导');
INSERT INTO `b_thing` VALUES (100, '经典塑形课程', 'c43726a1-7346-4a9d-8184-0ad7ccbb30ae.jpeg', '健身课程是专门设计用于提高体能水平、增强肌肉力量、改善心肺功能、塑造身材和提高健康水平的课程。这些课程通常由经过专业培训的健身教练或专家设计和指导，旨在帮助参与者达到他们的健身目标。\r\n\r\n以下是一些常见的健身课程类型简介：\r\n\r\n1. 有氧运动课程：包括有氧健身操、有氧舞蹈、有氧循环、有氧普拉提等，通过持续的有氧运动来提高心肺功能，燃烧脂肪并增强体能。\r\n\r\n2. 力量训练课程：包括举重、器械训练、体能训练等，旨在增强肌肉力量、耐力和体能，并帮助雕塑身体线条。\r\n\r\n3. 高强度间歇训练（HIIT）课程：结合高强度的爆发性运动和短暂的休息，以提高代谢率、燃烧脂肪并增强心肺功能。\r\n\r\n4. 瑜伽课程：包括不同类型如哈达瑜伽、阿斯汤伽、流瑜伽等，通过体式练习、呼吸调控和冥想来增强体魄、柔韧性和平衡能力。\r\n\r\n5. 普拉提课程：通过肌肉控制、呼吸和姿势练习来强化核心肌群、改善体态和灵活性。\r\n\r\n以上是健身课程的一些常见类型，每种课程都有不同的训练效果和目标，适合不同类型人群和健身需求。在选择健身课程时，可以根据自己的身体状况、健身目标和个人偏好来选择适合自己的课程类型，并在专业教练的指导下进行训练，以获得最佳的健身效果。', '233', '0', 0, '初级', '中年人', '减肥', '1719493734947', 3, 6, 0, 1, 1, 2, NULL, 2);
